import Typography from '@mui/material/Typography'
import { CounterState, DECREMENT_COUNTER, INCREMENT_COUNTER } from './counterReducer';
import { useDispatch, useSelector } from 'react-redux';
import { ButtonGroup, Button } from '@mui/material';
export default function ContactUs() {

    const {data,title}=useSelector((state:CounterState)=>state);
    const dispatch=useDispatch();
    return (
        <>
         <Typography gutterBottom  marginTop={10} variant="h2" color="initial">
         data:  {data}
        </Typography>
        <Typography variant="h2" color="initial">
         title:  {title}
        </Typography>
        <ButtonGroup>
            <Button onClick={()=>dispatch({ type: DECREMENT_COUNTER })} variant="contained" color="primary"/>
            <Button onClick={()=>dispatch({ type: INCREMENT_COUNTER })} variant="contained" color="secondary"/>

        </ButtonGroup>

        </>
       
    )
}
